'use strict'


const images = ['data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
];
const INDEX_QUERY_STRING_NAME = 'i';

let currentIndex = 0;

const [buttonPrev, buttonNext] = document.getElementsByTagName("button");

const setNextIndex = () => { currentIndex = ( currentIndex + 1 ) % images.length; updateImage() };

const setPrevIndex = () => { currentIndex = ( currentIndex - 1 + images.length ) % images.length; updateImage(); };

buttonPrev.onclick = setPrevIndex;

buttonNext.onclick = setNextIndex;


const slideContainer = document.getElementById("slideContainer");

function updateImage (){
    const image = new Image();
    image.onload = onImageLoad;
    image.src = images[currentIndex];
    onSliderChange();
}

function onImageLoad () {
    if ( ( this.width / this.height ) > ( 6 / 9 ) ){
        this.style.width = `${slideContainer.clientWidth}px`;//"100%";
    }
    else{
        this.style.height = `${slideContainer.clientHeight}px`;//"100%";
    }
    slideContainer.innerText = '';
    slideContainer.appendChild(this);

};


window.onload = function () {
    const params = new URLSearchParams(location.search);
    if ( params.has(INDEX_QUERY_STRING_NAME)){
        currentIndex = +params.get(INDEX_QUERY_STRING_NAME);
    }
    updateImage();
}

function  onSliderChange() {
    history.replaceState(null,null, `?${INDEX_QUERY_STRING_NAME}=${currentIndex}`)
}